import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for a product to trigger the price filter visibility
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results and price filter to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Fill in price range values
    await page.fill('#minPrice', '100');
    await page.fill('#maxPrice', '500');

    // Click apply filter button
    await page.click('.apply-filter');

    // Wait for filter to be applied
    await page.waitForTimeout(1000);

    // Take screenshot after applying price filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_filter_applied.png'));

    // Extract filter values to verify
    const minPriceValue = await page.$eval('#minPrice', el => el.value);
    const maxPriceValue = await page.$eval('#maxPrice', el => el.value);

    return {
      success: true,
      action: "Applied price range filter of $100-$500 to electronics search results",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
